import './App.scss';
import {BrowserRouter, Route, Routes } from "react-router-dom";
import Header from "./components/header/header";
import Routersconfig from "./config/Routersconfig";
import Footer from "./components/footer/footer";

function App() {
  return (
      <BrowserRouter>
          <Route render={props => (
              <>
                <Header {...props}/>
                <Routersconfig/>
                <Footer/>
              </>
          )}/>
      </BrowserRouter>
  );
}

export default App;
